content = ""
group = content[:4]

def allDifferent(group):
    for i in range(len(group)):
        for j in range(i+1, len(group)):
            if group[i] == group[j]:
                return False
    return True

for i in range(4, len(content)):
    if allDifferent(group):
        print("Part one:", i)
        break
    else:
        group = group[1:] + content[i]
        
group = content[:14]

for i in range(14, len(content)):
    if allDifferent(group):
        print("Part two:", i)
        exit()
    else:
        group = group[1:] + content[i]